In HTML code, we told the browser to load a script named main.js, so we need to create the file. Paste the next code to the new main.js file. import { PaperbitCanvas } from "./paperbit.js" const canvas = new PaperbitCanvas(document.body)
const { ellipse, mouse } = canvas.api canvas.api.onDraw = () => { ellipse(...mouse.pos, .1)
} This is a blank Paperbit template. In this script we can observe three different parts: Import the library import { PaperbitCanvas } from "./paperbit.js" The first line imports the PaperbitCanvas from the paperbit library, so we will have to download the library (witch will be a single file), and move it to the projects folder. Create the canvas const canvas = new PaperbitCanvas(document.body)
const { ellipse, mouse } = canvas.api The next two lines are creating a PaperbitCanvas instance in the body of our page. Then we are extracting the ellipse and mouse properties from the canvas api. We could call canvas.api.ellipse every time we need to draw an ellipse to the canvas, but it's cleaner to store the function in a constant. Draw to the canvas canvas.api.onDraw = () => { ellipse(...mouse.pos, .1)
} Now that we have the canvas and a draw function (ellipse), we can set up a draw event. When a new frame is requested the onDraw function will fire and the code will be executed. In this case we have an ellipse being drawn to the mouse position and with a size of 0.1 units. Note that the size of an ellipse usually is defined by two values (width and height). However, in this case that we omitted the height dimension Paperbit is going to create an ellipse of 0.1 units of width and height, aka a circle of 0.1 units of diameter.
